(function () {
    async function fetchVideoList(url) {
        console.log('fetch url :', url)
        const response = await fetch(url)
        const text = await response.text()
        return text
    }
    async function fetchVideoPart(url) {
        console.log('fetch item url :', url)
        const response = await fetch(url)
        const blob = await response.blob()
        return blob
    }
    async function mergeBlobs(mediaUrls) {
        const res = await Promise.all(mediaUrls.map(async (mediaUrl) => {
            return await fetchVideoPart(mediaUrl.url)
        })).then((blobs) => {
            const mergedBlob = new Blob(blobs, { type: 'video/mp4' })
            return mergedBlob
        })
        return res
    }
    async function mergeBatch(mediaUrls, target) {
        const blobs = []
        let total = mediaUrls.length
        for (let i = 0; i < mediaUrls.length; i += 100) {
            const tmp = await Promise.all(mediaUrls.slice(i, i + 100).map(async (mediaUrl) => {
                return fetch(mediaUrl.url).then(resp => resp.blob())
            })).then((b) => {
                const mergedBlob = new Blob(b, { type: 'video/mp4' })
                return mergedBlob
            })
            //计算百分比
            const current = Math.min(i + 100, total)
            target.textContent = (current / total) * 100 + '%'
            blobs.push(tmp)
        }
        return new Blob(blobs, { type: 'video/mp4' })
    }
    function createUrlElement(fileInfo) {
        const html = `
<div class="flex" style="height: auto; flex-wrap: wrap; padding: 5px;">
    <a style="color: lightgreen; font-weight: bold; border: 2px solid lightgreen; flex: 1 1 auto;">
        ${fileInfo.display}
    </a>
    <div class="flex flex-col justify-center" style="flex: 1 1 100%;">
        <span style="margin-left: 10px; font-style: italic; border-bottom: 2px groove lightgrey; color: white; font-size: 12px; height: 100%; align-content: end;">
            ${fileInfo.url}
        </span>
        <div style="height: 15%; width: 95%; background-color: red; margin-left: 10px;">
        </div>
    </div>
    <button style="margin-left: 10px; background-color: lightgray; color: black; flex: 1 1 auto;">复制</button>
    <button style="margin-left: 10px; background-color: lightgray; color: black; flex: 1 1 auto;" data-ref="${fileInfo.url}" data-prefix="${fileInfo.prefix}" file-name="test.mp4">下载</button>
</div>

<style>
    @media (max-width: 600px) {
        .flex {
            flex-direction: column;
            align-items: flex-start;
        }
        a, button {
            width: 50%;
            margin-left: 0;
            margin-bottom: 5px;
        }
    }
</style>

        `
        const flexDiv = document.createElement('div')
        flexDiv.innerHTML = html
        const copyButton = flexDiv.querySelector('button:nth-of-type(1)')
        const downloadButton = flexDiv.querySelector('button:nth-of-type(2)')
        copyButton.addEventListener('click', function () {
            navigator.clipboard.writeText(fileInfo.url + '#' + generateSafeFileName('span.font-medium')).then(() => {
                console.log('已复制文本：', fileInfo.url + '#' + generateSafeFileName('span.font-medium'))
                alert('链接已复制到剪贴板')
            }).catch(err => {
                console.error('复制文本时出错：', err)
                alert('复制失败，请稍后重试')
            })
        })
        downloadButton.addEventListener('click', async function (event) {
            var target = event.target
            target.disabled = true
            target.textContent = '下载中...'
            target.style.backgroundColor = 'lightgreen'
            var url = target.getAttribute('data-ref')
            var urlPrefix = target.getAttribute('data-prefix')
            const text = await fetchVideoList(url)
            const lines = text.split('\n')
            const mediaUrls = []
            lines.forEach(line => {
                if (line.trim() && !line.startsWith('#')) {
                    let name = line.trim().split('\\.')[0]
                    const index = parseInt(name.match(/\d+/)[0])
                    const fileInfo = {
                        index: index,
                        url: urlPrefix + line.trim()
                    }
                    mediaUrls.push(fileInfo)
                }
            })
            const blob = await mergeBatch(mediaUrls, target)
            const blobUrl = URL.createObjectURL(blob)
            const a = document.createElement('a')
            a.href = blobUrl
            a.download = fileInfo.filename
            a.click()
            setTimeout(() => {
                target.disabled = false
                target.textContent = '下载'
                target.style.backgroundColor = 'lightgray'
            }, 1000)
        })
        return flexDiv
    }
    function generateSafeFileName(selector) {
        let elements = document.querySelectorAll(selector)
        let combinedText = Array.from(elements)
            .map(element => element.textContent.trim())
            .join(' ')

        // 移除无效字符，确保文件名安全
        let safeFileName = combinedText.replace(/[\\/:*?"<>|]/g, '').substring(0, 100) // 限制文件名长度为100字符
        return safeFileName
    }
    window.addEventListener('load', () => {
        const tools = document.querySelector('.order-first .mt-4')
        const flexDiv = document.createElement('div')
        const filename = document.querySelector('.order-first .mt-4 h1').textContent.trim()
        flexDiv.className = 'flex justify-center space-x-4 md:space-x-6 py-8 rounded-md shadow-sm'
        flexDiv.style.flexDirection = 'column'
        flexDiv.style.alignItems = 'baseline'
        tools.removeChild(tools.children[1])
        tools.appendChild(flexDiv)
        const videoDoc = document.querySelector('.order-first')
        if (videoDoc != undefined) {
            const prefix = 'https://surrit.com/'
            const suffix = '/playlist.m3u8'
            const nodeValue = document.evaluate(
                '/html/body/script[5]/text()',
                document,
                null,
                XPathResult.FIRST_ORDERED_NODE_TYPE,
                null
            ).singleNodeValue.textContent
            const index = nodeValue.indexOf('seek')
            if (index !== -1 && index - 32 >= 0) {
                const first32Chars = nodeValue.substring(index - 38, index - 2)
                const url = prefix + first32Chars + suffix
                console.log('the m3u8 url is:', url)
                fetch(url).then(resp => resp.text()).then(text => {
                    const lines = text.split('\n')
                    const mediaUrls = []
                    lines.forEach(line => {
                        if (line.trim() && !line.startsWith('#')) {
                            const fileInfo = {
                                filename: filename,
                                prefix: prefix + first32Chars + '/' + line.trim().split('/')[0] + '/',
                                display: line.trim().split('/')[0],
                                url: prefix + first32Chars + '/' + line.trim()
                            }
                            flexDiv.appendChild(createUrlElement(fileInfo))
                        }
                    })
                    console.log(mediaUrls)
                })
            } else {
                console.log('\'seek\' 不在字符串中，或不足以截取32个字符。')
            }
        }
    })
})()
